scriptlet.script:
try {
	var mx = parseInt(mx);
	var totalmx = parseInt(totalmx);
	var used = parseInt(used);
	var totalused = parseInt(totalused);
	if (totalused == totalmx) {
		throw new Error("No more capacity for a new lab. Total number of labs used:" + totalused + ", max available:" + totalmx);	
	} 
	else if (used == mx) {
		throw new Error("No more capacity for a new lab " + program + ". Used:" + used + ", max available:" + mx);	
	}
	else {
		scriptletResponse="success";
	}
}
catch(Error) {
	scriptletContext.put("FailureMessage",Error);
	scriptletResponse="failure";
}

try {
	var pr = scriptletContext.get("RS_Previous_Response");
	if(pr == "more items") {
		var i = scriptletContext.get("I");
		i = (i != null && i != undefined && i.trim() != "")? JSON.parse(i): [];
		i.push(id);
		scriptletContext.put("I", JSON.stringify(i));
		scriptletResponse="more items";
	}
	else {
		var i = scriptletContext.get("I");
		i = (i != null && i != undefined && i.trim() != "")? JSON.parse(i): [];
		var mx = parseInt(mx);
		for(j = 1; j <= mx; j++) {
			var item = "" + j;
			if(i.indexOf(item) == -1) {
				scriptletContext.put("INDEX", item);
				scriptletResponse="success";	
				break;
			}
		}
	} 
}
catch(Error) {
	scriptletContext.put("FailureMessage",Error);
	scriptletResponse="failure";
}

try {
	var program = programName;
	if(program != null && program != undefined && program.trim() != "") {
		program = program.startsWith("CMT-")? "CMT": program;
		scriptletContext.put("program",program);
		scriptletResponse="success"
	}
	else {
		throw new Error("Program is undefined");
	}
}
catch(Error) {
	scriptletContext.put("FailureMEssage",Error);
	scriptletResponse="failure"
}
